import React from 'react';

export default function MainTitle(props) {
  return (
    <div className="landingTitle">
      <span>
        <h2>{props.title + " "}</h2>
        <h2 className="orange-text">{props.orangeTitle}</h2>
        <h2>{props.endTitle}</h2>
      </span>
      <p>{props.desc}</p>
    </div>
  );
}
